import React from "react";
import useFetchData from "../hooks/useFetchData";

const LanguageTable = () => {
  const { data, loading } = useFetchData();

  if (loading) return <div>Loading...</div>;

  return (
    <table>
      <thead>
        <tr>
          <th>Language</th>
          <th>GitHub</th>
          <th>Stack Overflow</th>
          <th>Google Trends</th>
          <th>Trend Score</th>
        </tr>
      </thead>
      <tbody>
        {data.map((item, index) => (
          <tr key={index}>
            <td>{item.language}</td>
            <td>{item.github}</td>
            <td>{item.stackoverflow}</td>
            <td>{item.google_trend}</td>
            <td>{item.trend_score}</td>
          </tr>
        ))}
      </tbody>
    </table>
  );
};

export default LanguageTable;
